// src/components/MenuList.jsx
import React from "react";

// Allergen icon map (you can expand it as needed)
const allergenIcons = {
  Gluten: "üåæ",
  Dairy: "ü•õ",
  Soy: "ü´ò",
  Eggs: "ü•ö",
  Fish: "üêü",
  Crustaceans: "ü¶ê",
  Celery: "ü•¨",
  Mustard: "üåø",
  Lupin: "üå∏",
  Molluscs: "üêö",
  Nuts: "ü•ú",
  Peanuts: "ü•ú",
  Sesame: "‚ö™",
  Sulphites: "üí®",
  None: "‚úÖ",
};

// Dietary icon map
const dietaryIcons = {
  Vegan: "üå±",
  Vegetarian: "ü•ï",
  "Gluten-Free": "üö´üåæ",
};

function MenuList({ items, filters, search, showHidden }) {
  const filterMatches = (item) => {
    const isVegan = item.Vegan?.toLowerCase() === "yes";
    const isVegetarian = item.Vegetarian?.toLowerCase() === "yes";
    const isGlutenFree = item["Gluten-Free"]?.toLowerCase() === "yes";

    if (filters.vegan && !isVegan) return false;
    if (filters.vegetarian && !isVegetarian) return false;
    if (filters.glutenfree && !isGlutenFree) return false;

    const allergens = item["Allergen Tags"]
      ? item["Allergen Tags"].split(",").map((a) => a.trim().toLowerCase())
      : [];

    for (const allergen of filters.allergens || []) {
      if (allergens.includes(allergen.toLowerCase())) {
        return false;
      }
    }

    return true;
  };

  const filteredItems = items.filter((item) => {
    if (!item["Dish Name"]) return false;
    const matchesSearch = search
      ? item["Dish Name"].toLowerCase().includes(search.toLowerCase())
      : true;
    return matchesSearch;
  });

  const grouped = {};
  filteredItems.forEach((item) => {
    const category = item.Category || "Other";
    if (!grouped[category]) grouped[category] = [];
    grouped[category].push(item);
  });

  return (
    <div className="px-4 py-4">
      {Object.keys(grouped).map((category) => (
        <div key={category} className="mb-6">
          <h2 className="text-xl font-semibold text-green-900 mb-2">
            {category}
          </h2>
          {grouped[category].map((item, i) => {
            const isSafe = filterMatches(item);

            return (
              <div
                key={i}
                className={`p-4 mb-3 rounded shadow-sm border transition ${
                  isSafe
                    ? "bg-white text-black"
                    : showHidden
                    ? "bg-gray-200 text-gray-500 opacity-60"
                    : "hidden"
                }`}
              >
                <div className="font-semibold">{item["Dish Name"]}</div>

                {item.Ingredients && (
                  <div className="text-sm">{item.Ingredients}</div>
                )}

                {item.Notes && (
                  <div className="italic text-xs text-gray-600 mt-1">
                    {item.Notes}
                  </div>
                )}

                <div className="flex flex-wrap items-center gap-2 mt-2">
                  {/* Dietary Icons */}
                  {item.Vegan?.toLowerCase() === "yes" && (
                    <span className="text-green-600 text-sm">
                      {dietaryIcons.Vegan} vegan
                    </span>
                  )}
                  {item.Vegetarian?.toLowerCase() === "yes" && (
                    <span className="text-green-600 text-sm">
                      {dietaryIcons.Vegetarian} vegetarian
                    </span>
                  )}
                  {item["Gluten-Free"]?.toLowerCase() === "yes" && (
                    <span className="text-green-600 text-sm">
                      {dietaryIcons["Gluten-Free"]} gluten-free
                    </span>
                  )}
                </div>

                {/* Allergens */}
                {item["Allergen Tags"] && item["Allergen Tags"].toLowerCase() !== "none" && (
                  <div className="mt-2 text-sm">
                    <span className="font-medium text-red-700 mr-1">
                      ‚ö† Allergens:
                    </span>
                    {item["Allergen Tags"]
                      .split(",")
                      .map((tag, index) => {
                        const trimmed = tag.trim();
                        const icon = allergenIcons[trimmed] || "‚ùó";
                        return (
                          <span key={index} className="mr-2">
                            {icon} {trimmed}
                          </span>
                        );
                      })}
                  </div>
                )}
              </div>
            );
          })}
        </div>
      ))}
    </div>
  );
}

export default MenuList;
